INSERT INTO `VideoInfo` VALUES ('015d3051-0e5a-469b-b025-e99af0b89fad','222','http://image2.pearvideo.com/main/20181224/10161303-114529-0.png','蒋里认为，AI可以很好地解决具象的封闭式问题。如何培养创新设计思维？如何才能不被AI取代？他将为你分享斯坦福设计思维，培养你的创造力。','http://video.pearvideo.com/mp4/third/20181224/cont-1496255-10161303-112235-hd.mp4','正常','ef7b875e-c561-4a68-a5a7-7cfa93938b51',1545633326209,1545633326209,0,'ac9369c6-180c-4476-922a-edea8868fe93'),('021fea4a-1361-4d49-8263-5329c2d04439','222','http://image2.pearvideo.com/main/20181224/11033396-111111-0.png','看到一栋完整的房子在路上移动，不要惊讶……美国一家公司居然能将整个房子轻松搬运，而且仅仅耗费几个小时。','http://video.pearvideo.com/mp4/third/20181224/cont-1496235-11033396-111047-hd.mp4','正常','1a203d0e-cfed-474b-99d6-7d50980b95a3',1545633326391,1545633326391,0,'c201804a-0eb2-4c99-b177-ded8487368e5'),('0305d69e-f530-49f4-9224-92e4755bf7c8','222','http://image.pearvideo.com/main/20181224/10132866-105037-0.png','一年一度的圣诞节来临，虽然室外寒风刺骨，但是丝毫挡不住技术宅内心的火热， 激情打造火焰圣诞树！喷火嘻哈嗨爆圣诞夜！','http://video.pearvideo.com/mp4/third/20181224/cont-1496179-10132866-100503-hd.mp4','正常','c4dd8a24-3dfc-4058-98fe-1545b99e35f5',1545633325756,1545633325756,0,'72a56b55-2503-4f1e-a05b-c320c1e2c63b'),('03128286-a246-42bc-8e05-2c5bf01c6c3a','222','http://image.pearvideo.com/main/20181224/11033396-110318-0.png','伦敦的MachineShop推出了一款3D液体打印机，震惊了不少人……','http://video.pearvideo.com/mp4/third/20181224/cont-1496227-11033396-110132-hd.mp4','正常','faa22ae9-34e2-44c4-89fe-8d787881cc55',1545633326002,1545633326002,0,'26bd8268-6ae7-4b14-b247-b7fd90352df4'),('034a969a-9491-4292-baca-f88e17f8bea8','222','http://image.pearvideo.com/main/20181221/11033396-202231-0.png','你们或许见过高山峡谷中的险桥，也见过断在海里的桥，但是你们见过能“扭来扭去”的桥吗？','http://video.pearvideo.com/mp4/third/20181221/cont-1495614-11033396-202124-hd.mp4','正常','56d0d350-40cd-40a4-bc6c-c2bb2cf43b77',1545633326322,1545633326322,0,'ee3c60a8-0ec7-4670-8a9e-96f82fe484c2'),('039628f3-9fb8-49a5-be58-896d66699ac4','222','http://image2.pearvideo.com/cont/20181222/cont-1495884-11763704.jpg','12月18日，世界顶尖学术期刊英国《自然》杂志发布了2018年度十大科学人物